import { Icon, Menu } from "antd";
import styled from "styled-components";
import Link from "next/link";
const NavlinkWrapper = styled.div`
	display: flex;
	justify-content: center;
	color: white;
	float: lef;
`;

const Navlinks = () => (
	<NavlinkWrapper>
		<Link to="/">
			<Icon type="home" />
		</Link>
		<Link to="/about-me">
			<Icon type="user" />
		</Link>
	</NavlinkWrapper>
);
export default Navlinks;
